import React from 'react';

const ZodiacSymbol = ({ symbol, name, size = 'md', className = '' }) => {
  const sizeClasses = {
    sm: 'text-2xl',
    md: 'text-4xl',
    lg: 'text-6xl',
    small: 'text-2xl',
  };

  return (
    <div 
      className={`zodiac-symbol ${sizeClasses[size]} animate-fadeIn ${className}`} 
      title={name}
      style={{ display: 'inline-flex', justifyContent: 'center', alignItems: 'center' }}
    >
      {symbol || '★'}
    </div>
  );
};

export default ZodiacSymbol;
